import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'font-awesome/css/font-awesome.min.css';

function UserCreation() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    age: '',
    username: '',
    password: ''
  });

  const [errors, setErrors] = useState({});

  const validateField = (name, value) => {
    let error = '';
    if (!value) {
      error = 'This field is required.';
    } else {
      switch (name) {
        case 'firstName':
        case 'lastName':
          if (!/^[a-zA-Z0-9]+$/.test(value)) {
            error = 'Only alphanumeric characters are allowed.';
          } else if (value.length < 2 || value.length > 50) {
            error = 'Must be between 2 and 50 characters.';
          }
          break;
        case 'age':
          if (isNaN(value) || value <= 0) {
            error = 'Age must be a positive number.';
          }
          break;
        case 'username':
          if (value.length < 5 || value.length > 50) {
            error = 'Must be between 5 and 50 characters.';
          }
          break;
        case 'password':
          const passwordComplexity = /^(?=.*[A-Z])(?=.*[a-z])(?=.*\d)(?=.*[!@#$%^&*(),.?\":{}|<>]).{8,}$/;
          if (!passwordComplexity.test(value)) {
            error = 'Password must be at least 8 characters long and include an uppercase letter, a lowercase letter, a number, and a special character.';
          }
          break;
        default:
          break;
      }
    }
    return error;
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
    setErrors({ ...errors, [name]: validateField(name, value) });
  };

  const isFormValid = Object.values(errors).every((error) => !error) &&
                      Object.values(formData).every((value) => value);

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg" style={{ backgroundColor: '#a2c2e1' }}>
        <div className="container-fluid">
          <a className="navbar-brand text-dark" href="/home">Mental Wellness</a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <i className="fa fa-bars"></i>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link text-dark" href="/dashboard">Dashboard</a>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      {/* Create Account Form */}
      <div className="container mt-5" style={{ backgroundColor: '#f6f4f5', padding: '20px', borderRadius: '10px' }}>
        <h2 className="text-center mb-4" style={{ color: '#333333' }}>Create Account</h2>
        <form id="createAccountForm" className="p-4 shadow rounded" style={{ backgroundColor: '#ffffff' }}>
          {['firstName', 'lastName', 'age', 'username', 'password'].map((field) => (
            <div className="mb-3" key={field}>
              <label htmlFor={field} className="form-label" style={{ color: '#333333' }}>
                {field.charAt(0).toUpperCase() + field.slice(1).replace(/([A-Z])/g, ' $1')}
              </label>
              <input
                type={field === 'password' ? 'password' : field === 'age' ? 'number' : 'text'}
                className={`form-control ${errors[field] ? 'is-invalid' : ''}`}
                id={field}
                name={field}
                value={formData[field]}
                onChange={handleChange}
                required
              />
              {errors[field] && <div className="invalid-feedback">{errors[field]}</div>}
            </div>
          ))}
          <button
            type="submit"
            className="btn btn-primary w-100"
            style={{ backgroundColor: '#333333', borderColor: '#333333' }}
            disabled={!isFormValid}
          >
            Create Account
          </button>
        </form>
      </div>

      {/* Footer */}
      <footer className="py-4 mt-5" style={{ backgroundColor: '#333333', color: '#fefefe' }}>
        <div className="container">
          <div className="row">
            <div className="col-md-4">
              <h5>About Mental Wellness</h5>
              <p>
                At Mental Wellness, our mission is to provide expert mental health care and
                wellness support to individuals worldwide. We are committed to helping
                you live a happier, healthier life.
              </p>
            </div>
            <div className="col-md-2">
              <h5>Quick Links</h5>
              <ul className="list-unstyled">
                <li><a href="/services" className="text-light">Services</a></li>
                <li><a href="/about" className="text-light">About Us</a></li>
                <li><a href="/contact" className="text-light">Contact</a></li>
                <li><a href="/faq" className="text-light">FAQ</a></li>
                <li><a href="/privacy" className="text-light">Privacy Policy</a></li>
              </ul>
            </div>
            <div className="col-md-3">
              <h5>Contact Us</h5>
              <p>Email: <a href="mailto:support@mentalwellness.com" className="text-light">support@mentalwellness.com</a></p>
              <p>Phone: <a href="tel:+1234567890" className="text-light">+1 (234) 567-890</a></p>
              <p>Address: 123 Wellness St, Health City, 56789</p>
            </div>
            <div className="col-md-3">
              <h5>Follow Us</h5>
              <div className="d-flex">
                <a href="#" className="btn btn-outline-light me-2"><i className="fa fa-facebook"></i></a>
                <a href="#" className="btn btn-outline-light me-2"><i className="fa fa-twitter"></i></a>
                <a href="#" className="btn btn-outline-light me-2"><i className="fa fa-instagram"></i></a>
                <a href="#" className="btn btn-outline-light"><i className="fa fa-linkedin"></i></a>
              </div>
            </div>
          </div>
          <div className="text-center mt-4">
            <p>&copy; 2024 Mental Wellness. All rights reserved.</p>
          </div>
        </div>
      </footer>
    </div> 
  );
}

export default UserCreation;
